def image_path(name):
    return f'\\{name}'


def path_back(path):
    count = 0
    for i in path[::-1]:
        count += 1
        if i == '/':
            break
    else:
        return None
    return path[:-count]


def add(addition):
    origin = st.session_state['path']
    if origin is None:
        return addition
    else:
        return '{}/{}'.format(origin, addition)


